message:
*CDBr INFORMA:*

*Primeiro Mês do Governo Comunista e está apenas começando a destruição do nosso país.*

🤡 Aborto legalizado;
🤡Ter opinião política virou motivo de processo e até prisão;
🤡População de bem desarmada, e criminosos não;
🤡Marco do saneamento revogado;
🤡Nordeste volta à máfia dos caminhões pipa;
🤡Bolsa caindo: já perdeu 546 bilhões
🤡Extinção da secretaria da alfabetização no MEC
🤡Aulas bilíngue para surdos já era;
🤡 Gasolina sobe 3% e fica acima de R$ 5 na primeira semana de 2023;
🤡10 bilhões pra Cultura;
🤡Retrocesso nas privatizaçöes;
🤡Acabou saque de aniversário do FGTS;
🤡 99Food encerra atividades de delivery com entregadores de aplicativo;
🤡 Atual governo federal faz demissão em massa e exonera 1.024 servidores públicos;
🤡 STF proíbe demissão sem justa causa e decreta prisão e multa de manifestantes;
🤡 Governo comunista do PT agora vai começar a taxar o sol, quem tem energia solar vai pagar uma taxa para o novo governo esquerdista;
🤡 Governo Lula manda fechar a água do canal da transposição para voltar a mafia dos carros pipas dos seus parceiros politicos da esquerda para continuar a escravização do povo para poder formar seu curral eleitoral,
🤡 Quem ganha um salário e meio por mês passará a pagar imposto de renda a partir desse ano de 2023 ao governo Socialista.

*AOS TROUXAS QUE VOTARAM NESSA ORGANIZAÇÃO CRIMINOSA DO PT... FAZ UM "L" BANDO DE FILHO DA P###!*

