Bolsa Bolsa cayendo: ya perdió 546 mil millones
Extinção extinción de la Secretaría de alfabetización en el MEC
Clases bilingües para sordos;
Gasolina Gasolina sube 3% y se mantiene por encima de R 5 5 en la primera semana de 2023;
Cultura 10 mil millones para la Cultura;
Retroceso en la privatización;
Saque se acabó el botín de cumpleaños del FGTS;
